import React, { Component } from "react";
import { Paper, Container, Box, TextField , Button} from "@material-ui/core";

export default class Login extends Component {
    constructor(props){
        super(props)
        this.state={
            username:"masai",
            password:"school"
        }
    }
  render() {
    return (
      <Container>
        <Box>
          <Paper className="col-4 mt-5 offset-4 justify-content-center " elevation={3} >
            <h2 className="text-center">LOGIN </h2>
            <form className="mt-3 mb-5" noValidate autoComplete="off">

              <TextField id="filled-full-width" label="USERNAME" placeholder="Enter your Username"
                fullWidth margin="normal"
                InputLabelProps={{
                  shrink: true
                }}
                variant="filled"
              />

              <br></br>

              <TextField id="filled-full-width" label="PASSWORD" placeholder="Enter your Password"
                fullWidth margin="normal" onChange=""
                InputLabelProps={{
                  shrink: true
                }}
               variant="filled"
              />

              <br></br>

              <div className="text-center"> 
              <Button  className=" mt-2 "  variant="contained" color="primary">
                SIGN IN
              </Button>
              </div>

              <br></br>
              <br></br>
            </form>
          </Paper>
        </Box>
      </Container>
    );
  }
}
